      edges:
        - node:
            text: >-
              Skuggorna sträcker sig ännu längre på kvällen, ljuset däremot
              varar inte lika länge. #Hösten närmar sig och med sig har den
              tagit inomhusmys och härliga stämningar. Äntligen får vi ta ut vår
              #favoritjacka ur garderoben, gräva ner oss i våra halsdukar när vi
              går ut i den friska och svala luften.


              Det kan också kännas överväldigande att ta sig in i
              #höststämningen med kylan, fukten och mörkret den bär på. Sommaren
              lämnar alltid lite spår efter sig där hemma och gör sig #vemodigt
              påmind med dess högpunkter och dess energi. Vi har sprungit in och
              ut barfota och det syns på våra golv. Vi har haft fönstren öppna
              hela dagarna och dam från #stadslivet har lagt sig på våra möbler.


              Så varför inte göra det lätt för dig och boka #storstädning? Om du
              låter oss städa bort #sommaren2019, så kan du fokusera på att ta
              in alla vackra #intryck, färger och stämningar som vår vackra stad
              #Stockholm bjuder på under hösten.
